import { ActivatedRouteSnapshot, RouterStateSnapshot } from "@angular/router";
import { CookieHelper } from "src/service/cookie.service";

export const conferenceGuard = (route: ActivatedRouteSnapshot, state: RouterStateSnapshot) => {
    return !!CookieHelper.getFromCookies("name");
};
